import * as React from 'react';
import Box from '@mui/material/Box';
import { Typography } from '@mui/material';

export default function BoxSystemProps({ job }) {
  return (
    <Box
      height={200}
      width={300}
      my={5}
      display="flex"
      flexDirection="column"
      justifyContent="flex-start"
      p={2}
      marginLeft={5}
      borderRadius={3}
      sx={{ border: '2px solid grey' }}
    >
      <Typography
        textAlign="center"
        sx={{ marginBottom: '16px' }} // Khoảng cách dưới tiêu đề
      >
        {job.title}
      </Typography>
      <Box>
        {job.skills}
      </Box>
    </Box>
  );
}
